import React from 'react';
import logo from '../img/logo.png';
import './Navbar.css';
import { Link } from 'react-router-dom';
export default function Navbar() {
  return (
    <div className="Navbar">
      <img src={logo} alt='Logo' />
      <ul className="nav-menu">
        <Link ><li>SignUp</li></Link>
        <li>SignIn</li>
        <li>Profile</li>
        </ul>
    
    </div>
  );
}
